import React from ' react';

const Canvas = () => {
    const style = {
        border: '1px solid black',
    };
    return (
        <svg
            id="aliens-go-home-cavas"
            preserveAspectRatio="xMaxYMax none"
            style={style}
        >
            <circle cs={0} cy={0} r={50} />
        </svg>
    );
};

export default Canvas;
